import styles from "./Explorer.module.scss";
import PosterComponent from "../poster/Poster";
import JumpBar from "../jumpbar/JumpBar";
//
import VisibilityIcon from "@mui/icons-material/Visibility";
import FilterListIcon from "@mui/icons-material/FilterList";
import FilterAltIcon from "@mui/icons-material/FilterAlt";
import AppsIcon from "@mui/icons-material/Apps";
//
import ToolBarOption from "../ToolBarOption/ToolBarOption";
const ExplorerComponent = () => {
	const numberOfComponents = 35;
	const posters = [];
	const test = AppsIcon;

	for (let i: number = 1; i < numberOfComponents; i++) {
		posters.push(<PosterComponent id={i} />);
	}
	return (
		<div className={styles.explorer}>
			<div className={styles.toolBar}>
				<div className={styles.left}>
					<div className={styles.update}>Update</div>
					<div className={styles.rss}>RSS</div>
				</div>
				<div className={styles.right}>
					<div className={styles.options}>
						<AppsIcon className={styles.svg} />
						<div className={styles.text}>Options</div>
					</div>
					<ToolBarOption
						text="Options"
						icon={<AppsIcon style={{ fontSize: "large" }} />}
					/>
					<div className={styles.seperator}></div>
					<div className={styles.view}>View</div>
					<div className={styles.sort}>Sort</div>
					<div className={styles.filter}>Filter</div>
				</div>
			</div>
			<div className={styles.explorerContent}>
				<div className={styles.contentContainer}>
					<div className={styles.content}>{posters}</div>
				</div>
				<JumpBar />
			</div>
		</div>
	);
};
export default ExplorerComponent;
